import './App.css';
import Chat from './Chat';
import { useState } from 'react';
import Login from './Login';

function App() {
  const [isAuth, setIsAuth] = useState(false);
  return (
    <div className="App">
      {
        isAuth ?
        <Chat />
        : <Login loginClicked />
      }
    </div>
  );
}

export default App;
